import React from 'react';
import TextField from '@material-ui/core/TextField';

const InputItem = () => (<p>
    <TextField
        id="standard-dense"
        label="Добавить задание"
        margin="dense"
        fullWidth
    />
    <TextField
        id="filled-full-width"
        label="Label"
        style={{ margin: 8 }}
        placeholder="Placeholder"
        helperText="Full width!"
        fullWidth
        margin="normal"
        variant="filled"
        InputLabelProps={{
            shrink: true,
        }}
    />
</p>);

export default InputItem;
